import React from "react";
import "./Card.css";
const Card = ({ slide }) => {
  return (
    <div className="cardContainer">
      <div className="slideImage">
        <img src={slide.img}></img>
      </div>
      <div className="slideInfo">
        <h1>{slide.title}</h1>
        <p>{slide.description}</p>
      </div>
    </div>
  );
};
export default Card;
